import React from "react";

const Player = () => {
  return (
    <div className="player-container">
      <div className="player-timeflow">
        <p>Start-time</p>
        <input type="range" name="player" id="player" />
        <p>End-time</p>
      </div>
      <div className="controler">
        <p>previous Icon</p>
        <p>stop/play icon</p>
        <p>next Icon</p>
      </div>
    </div>
  );
};

export default Player;
